Define HTTP headers sent with the request in the HTTP conform header representation . If you want to use the parameter braces ({{, }}) without substitution, you can escape them using a backslash. Example: [Body]
```
{ "user": { "name": "\{\{This will not be substituted\}\}", "favorite_programming_langs": [ "Go", "Rust" ], }
}
```

