Template parameters in Goatfiles are defined inside double-braces ({{ }}). Variables from the state are referenced using a dot-notation. Let's take a look at the following example. We have the following state. instance: "http://example.com" credentials: username: "foobar" password: "password" Now, we can reference the values in our state as following. POST {{.instance}}/api/v1/auth/login [Body]
{ "username": "{{.credentials.username}}" "password": "{{.credentials.password}}"
} Functions can be called using the name of the function followed by the parameters separated by spaces. Lets take a look at the followign example. Weassume the following state. name: "Max" {{ printf "Hello, %s!" .name }} This will result in the string value "Hello, Max!". There are also a lot of builtin functions you can use in your Goatfiles.
